#include <stdlib.h>
#include <string.h>

int isPrime(int num) {
    if (num <= 1) return 0;
    for (int i = 2; i * i <= num; i++) {
        if (num % i == 0) return 0;
    }
    return 1;
}

int** findPrimePairs(int n, int* returnSize, int** returnColumnSizes) {
    int** result = (int**)malloc(sizeof(int*) * n / 2); // Allocate max possible pairs
    *returnColumnSizes = (int*)malloc(sizeof(int) * n / 2);
    *returnSize = 0;
    for (int x = 2; x <= n / 2; x++) {
        if (isPrime(x) && isPrime(n - x)) {
            result[*returnSize] = (int*)malloc(sizeof(int) * 2);
            result[*returnSize][0] = x;
            result[*returnSize][1] = n - x;
            (*returnColumnSizes)[*returnSize] = 2;
            (*returnSize)++;
        }
    }
    result = (int**)realloc(result, sizeof(int*) * (*returnSize)); // Adjust memory allocation
    *returnColumnSizes = (int*)realloc(*returnColumnSizes, sizeof(int) * (*returnSize));
    return result;
}
